def format_profit_ranking(profits: List[Dict[str, Any]]) -> str:
    """Format profit ranking for display"""
    if not profits:
        return "No profits or losses found"
    
    output = []
    
    # Split into profits and losses
    profit_entries = [p for p in profits if p['total_profit_usd'] > 0]
    loss_entries = [p for p in profits if p['total_profit_usd'] < 0]
    
    if profit_entries:
        output.append("\nTop Profits:")
        output.append("-" * 80)
        for rank, profit_info in enumerate(profit_entries, 1):
            lines = []
            lines.append(f"\nRank #{rank}: {profit_info['address']}")
            lines.append(f"Total Profit: ${profit_info['total_profit_usd']:,.2f}")
            
            if profit_info['profit_breakdown']:
                lines.append("Profit Breakdown:")
                for token_addr, token_data in profit_info['profit_breakdown'].items():
                    symbol = token_data['symbol']
                    amount = token_data['amount']
                    usd = token_data['amount_usd']
                    if token_addr == "0x0000000000000000000000000000000000000000":  # ETH
                        lines.append(f"  {symbol}: {amount:,.18f} (${usd:,.2f})")
                    else:
                        lines.append(f"  {symbol} ({token_addr}): {amount:,.18f} (${usd:,.2f})")
            output.extend(lines)
    
    if loss_entries:
        output.append("\nLosses:")
        output.append("-" * 80)
        for loss_info in loss_entries:
            lines = []
            lines.append(f"\n{loss_info['address']}")
            lines.append(f"Total Loss: ${loss_info['total_profit_usd']:,.2f}")
            
            if loss_info['profit_breakdown']:
                lines.append("Loss Breakdown:")
                for token_addr, token_data in loss_info['profit_breakdown'].items():
                    symbol = token_data['symbol']
                    amount = token_data['amount']
                    usd = token_data['amount_usd']
                    if token_addr == "0x0000000000000000000000000000000000000000":  # ETH
                        lines.append(f"  {symbol}: {amount:,.18f} (${usd:,.2f})")
                    else:
                        lines.append(f"  {symbol} ({token_addr}): {amount:,.18f} (${usd:,.2f})")
            output.extend(lines)
    
    return '\n'.join(output)

